class NavBar extends Component {
    render () {
        const {list} = this.props;

        return (
            <div className="jumbotron navbar navbar-expand-lg navbar-light bg-light" style={{background: 'url(https://ru.best-wallpaper.net/wallpaper/1920x1200/1801/Lot-of-dogs-sit-in-a-line_1920x1200.jpg)'}}>
                <div className="collapse navbar-collapse" id="navbarNav">
                    <ul className="navbar-nav">
                        <li className="nav-item active">

                            <a className="nav-link btn btn-lg" href="#listOfDogs">Dogs List<span className="sr-only">(current)</span></a>
                        </li>
                    </ul>
                </div>
            </div>
            )
    }
}

export default NavBar;
